text:
{'text': 'This place has a lively and vibrant atmosphere, making it a great spot for happy hour.

The drinks menu is well-priced during happy hour, with a good selection of cocktails, beers, and wines. The cocktails are well-mixed and refreshing.

The ambiance, enhanced by live music, creates a fun and relaxed vibe, perfect for unwinding after work. Service is friendly and attentive. It is a great spot for drinks and good vibes.', 'languageCode': 'en'}

